import logo from './logo.svg';
import './App.css';
import{
  BrowserRowter,
  Switch,
  Route,
  Link
}from "react-router-dom";
function App() {
  return (
    <BrowserRowter>
      <p>
        <link to="/">home</link>
        <link to="/about">about</link>
      </p>
      <Switch>
        <Route path="/about">
          <About />
        </Route>
        <Route exact path="/">
          <Home />
        </Route>
      </Switch>

    </BrowserRowter>
  );
}

export default App;
